<node COLOR="#0033ff" CREATED="1412245728464" FOLDED="true" HGAP="23" ID="ID_159410408" MODIFIED="1412249445572" POSITION="left" TEXT="Interpreted / Compiled" VSHIFT="-5">
<edge STYLE="sharp_bezier" WIDTH="8"/>
<font NAME="SansSerif" SIZE="18"/>
<node COLOR="#00b439" CREATED="1412245747331" FOLDED="true" ID="ID_1218961869" MODIFIED="1412249445417" TEXT="Interpreted">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      <font face="sans-serif" color="rgb(37, 37, 37)">An&#160;</font><b style="text-indent: 0px; font-variant: normal; text-transform: none; background-color: rgb(255, 255, 255); color: rgb(37, 37, 37); word-spacing: 0px; letter-spacing: normal; font-style: normal; line-height: 22.3999996185303px; font-family: sans-serif; font-size: 14px; white-space: normal; text-align: start"><font size="14px" color="rgb(37, 37, 37)" face="sans-serif">interpreted language</font></b><font color="rgb(37, 37, 37)" face="sans-serif">&#160;is a&#160;</font><a title="Programming language" style="background-image: null; text-indent: 0px; font-variant: normal; color: rgb(11, 0, 128); background-color: rgb(255,; word-spacing: 0px; background-position: 255, 255); text-transform: none; letter-spacing: normal; font-weight: normal; font-style: normal; line-height: 22.3999996185303px; background-repeat: repeat; font-family: sans-serif; font-size: 14px; text-decoration: none; white-space: normal; background-attachment: scroll; text-align: start" href="http://en.wikipedia.org/wiki/Programming_language"><font size="14px" color="rgb(11, 0, 128)" face="sans-serif">programming language</font></a><font color="rgb(37, 37, 37)" face="sans-serif">&#160;for which most of its implementations execute instructions directly, without previously&#160;</font><a title="Compiler" style="background-image: null; text-indent: 0px; font-variant: normal; color: rgb(11, 0, 128); background-color: rgb(255,; word-spacing: 0px; background-position: 255, 255); text-transform: none; letter-spacing: normal; font-weight: normal; font-style: normal; line-height: 22.3999996185303px; background-repeat: repeat; font-family: sans-serif; font-size: 14px; text-decoration: none; white-space: normal; background-attachment: scroll; text-align: start" href="http://en.wikipedia.org/wiki/Compiler"><font size="14px" color="rgb(11, 0, 128)" face="sans-serif">compiling</font></a><font color="rgb(37, 37, 37)" face="sans-serif">&#160;a&#160;</font><a title="Computer program" style="background-image: null; text-indent: 0px; font-variant: normal; color: rgb(11, 0, 128); background-color: rgb(255,; word-spacing: 0px; background-position: 255, 255); text-transform: none; letter-spacing: normal; font-weight: normal; font-style: normal; line-height: 22.3999996185303px; background-repeat: repeat; font-family: sans-serif; font-size: 14px; text-decoration: none; white-space: normal; background-attachment: scroll; text-align: start" href="http://en.wikipedia.org/wiki/Computer_program"><font size="14px" color="rgb(11, 0, 128)" face="sans-serif">program</font></a><font color="rgb(37, 37, 37)" face="sans-serif">&#160;into&#160;</font><a class="mw-redirect" title="Machine language" style="background-image: null; text-indent: 0px; font-variant: normal; color: rgb(11, 0, 128); background-color: rgb(255,; word-spacing: 0px; background-position: 255, 255); text-transform: none; letter-spacing: normal; font-weight: normal; font-style: normal; line-height: 22.3999996185303px; background-repeat: repeat; font-family: sans-serif; font-size: 14px; text-decoration: none; white-space: normal; background-attachment: scroll; text-align: start" href="http://en.wikipedia.org/wiki/Machine_language"><font size="14px" color="rgb(11, 0, 128)" face="sans-serif">machine-language</font></a><font color="rgb(37, 37, 37)" face="sans-serif">&#160;instructions. The&#160;</font><a title="Interpreter (computing)" style="background-image: null; text-indent: 0px; font-variant: normal; color: rgb(11, 0, 128); background-color: rgb(255,; word-spacing: 0px; background-position: 255, 255); text-transform: none; letter-spacing: normal; font-weight: normal; font-style: normal; line-height: 22.3999996185303px; background-repeat: repeat; font-family: sans-serif; font-size: 14px; text-decoration: none; white-space: normal; background-attachment: scroll; text-align: start" href="http://en.wikipedia.org/wiki/Interpreter_(computing)"><font size="14px" color="rgb(11, 0, 128)" face="sans-serif">interpreter</font></a><font color="rgb(37, 37, 37)" face="sans-serif">&#160;executes the program directly, translating each statement into a sequence of one or more&#160;</font><a class="mw-redirect" title="Subroutines" style="background-image: null; text-indent: 0px; font-variant: normal; color: rgb(11, 0, 128); background-color: rgb(255,; word-spacing: 0px; background-position: 255, 255); text-transform: none; letter-spacing: normal; font-weight: normal; font-style: normal; line-height: 22.3999996185303px; background-repeat: repeat; font-family: sans-serif; font-size: 14px; text-decoration: none; white-space: normal; background-attachment: scroll; text-align: start" href="http://en.wikipedia.org/wiki/Subroutines"><font size="14px" color="rgb(11, 0, 128)" face="sans-serif">subroutines</font></a><font color="rgb(37, 37, 37)" face="sans-serif">&#160;already compiled into machine code. </font>
    </p>
    <p>
      
    </p>
    <p>
      <font color="rgb(37, 37, 37)" face="sans-serif">Like 'Machine language' </font>
    </p>
    <p>
      
    </p>
    <p>
      <font color="rgb(37, 37, 37)" face="sans-serif">Disavantages: </font>
    </p>
    <p>
      <font size="14px" color="rgb(37, 37, 37)" face="sans-serif">The main disadvantage of interpreting is a much slower speed of program execution compared to direct</font><font color="rgb(37, 37, 37)" face="sans-serif">&#160;</font><a title="Machine code" style="background-image: null; text-indent: 0px; font-variant: normal; color: rgb(11, 0, 128); background-color: rgb(255,; word-spacing: 0px; background-position: 255, 255); text-transform: none; letter-spacing: normal; font-weight: normal; font-style: normal; line-height: 22.3999996185303px; background-repeat: repeat; font-family: sans-serif; font-size: 14px; text-decoration: none; white-space: normal; background-attachment: scroll; text-align: start" href="http://en.wikipedia.org/wiki/Machine_code"><font size="14px" color="rgb(11, 0, 128)" face="sans-serif">machine code</font></a><font color="rgb(37, 37, 37)" face="sans-serif">&#160;</font><font size="14px" color="rgb(37, 37, 37)" face="sans-serif">execution on the host</font><font color="rgb(37, 37, 37)" face="sans-serif">&#160;</font><a class="mw-redirect" title="CPU" style="background-image: null; text-indent: 0px; font-variant: normal; color: rgb(11, 0, 128); background-color: rgb(255,; word-spacing: 0px; background-position: 255, 255); text-transform: none; letter-spacing: normal; font-weight: normal; font-style: normal; line-height: 22.3999996185303px; background-repeat: repeat; font-family: sans-serif; font-size: 14px; text-decoration: none; white-space: normal; background-attachment: scroll; text-align: start" href="http://en.wikipedia.org/wiki/CPU"><font size="14px" color="rgb(11, 0, 128)" face="sans-serif">CPU</font></a><font size="14px" color="rgb(37, 37, 37)" face="sans-serif">. A technique used to improve performance is</font><font color="rgb(37, 37, 37)" face="sans-serif">&#160;</font><a title="Just-in-time compilation" style="background-image: null; text-indent: 0px; font-variant: normal; color: rgb(11, 0, 128); background-color: rgb(255,; word-spacing: 0px; background-position: 255, 255); text-transform: none; letter-spacing: normal; font-weight: normal; font-style: normal; line-height: 22.3999996185303px; background-repeat: repeat; font-family: sans-serif; font-size: 14px; text-decoration: none; white-space: normal; background-attachment: scroll; text-align: start" href="http://en.wikipedia.org/wiki/Just-in-time_compilation"><font size="14px" color="rgb(11, 0, 128)" face="sans-serif">just-in-time compilation</font></a><font color="rgb(37, 37, 37)" face="sans-serif">&#160;</font><font size="14px" color="rgb(37, 37, 37)" face="sans-serif">which converts frequently executed sequences of interpreted instruction to host machine code. </font>
    </p>
    <p>
      
    </p>
    <p>
      <font color="rgb(37, 37, 37)" face="sans-serif">- Wikipedia - </font>
    </p>
  </body>
</html>
</richcontent>
